INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(1, 'Phòng khám Thu Cúc', 'Hà Nội', 'Phòng khám Đa khoa Thu Cúc Đại Từ tọa lạc tại cửa ngõ phía Nam Thủ đô, tiếp giáp với các khu vực đông dân cư, đồng thời thuận tiện cả về giao thông nội đô và giao thông liên tỉnh. Ước tính mỗi ngày, cơ sở tiếp đón đến hàng ngàn lượt khách hàng cá nhân và doanh nghiệp tới thăm khám, sử dụng các dịch vụ y tế.', '<p>Phòng khám Đa khoa Thu Cúc Đại Từ tọa lạc tại cửa ngõ phía Nam Thủ đô, tiếp giáp với các khu vực đông dân cư, đồng thời thuận tiện cả về giao thông nội đô và giao thông liên tỉnh. Ước tính mỗi ngày, cơ sở tiếp đón đến hàng ngàn lượt khách hàng cá nhân và doanh nghiệp tới thăm khám, sử dụng các dịch vụ y tế.</p>\r\n', , '2025-06-10 22:43:43', '2025-06-10 22:43:43');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Phòng khám Hồng Phát', 'TP.HCM', 'Bệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện quy tụ đội ngũ các bác sĩ và chuyên gia y tế hàng đầu tại Việt Nam có trình độ chuyên môn cao, giàu kinh nghiệm đến từ các bệnh viện lớn nhất cả nước với mục đích chung cùng nhau “xây dựng Bệnh viện Đa khoa Hồng Phát trở thành bệnh viện tư nhân uy tín hàng đầu Việt Nam và khu vực”.', '<p>Bệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện quy tụ đội ngũ các bác sĩ và chuyên gia y tế hàng đầu tại Việt Nam có trình độ chuyên môn cao, giàu kinh nghiệm đến từ các bệnh viện lớn nhất cả nước với mục đích chung cùng nhau “xây dựng Bệnh viện Đa khoa Hồng Phát trở thành bệnh viện tư nhân uy tín hàng đầu Việt Nam và khu vực”.</p>\r\n', , '2025-06-14 13:23:45', '2025-06-14 13:23:45');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Phòng Khám Medatec', 'Huế', 'Bệnh viện Medlatec là cơ sở y tế được trang bị cơ sở vật chất hiện đại như Hệ thống máy xét nghiệm đạt chuẩn quốc tế, Máy chụp Cộng hưởng từ (MRI), Máy chụp CT và cung cấp các dịch vụ thăm khám và điều trị đa khoa như: Khám tổng quát, tiêu hóa, gan mật tụy, hô hấp, cơ xương khớp ...', '<p>Bệnh viện Medlatec là cơ sở y tế được trang bị cơ sở vật chất hiện đại như Hệ thống máy xét nghiệm đạt chuẩn quốc tế, Máy chụp Cộng hưởng từ (MRI), Máy chụp CT và cung cấp các dịch vụ thăm khám và điều trị đa khoa như: Khám tổng quát, tiêu hóa, gan mật tụy, hô hấp, cơ xương khớp ...</p>\r\n', , '2025-06-19 14:32:20', '2025-06-19 14:32:20');
