(4, 'Bệnh viện Chợ Rẫy', 'Hồ Chí Minh', 'Bệnh viện Chợ Rẫy là một bệnh viện đa khoa trung ương cấp quốc gia, phục vụ Nam Bộ, nằm tại Quận 5, Thành phố Hồ Chí Minh. Đây là bệnh viện tuyến cuối hạng đặc biệt trực thuộc Bộ Y tế, đồng thời là trung tâm nghiên cứu khoa học, chỉ đạo tuyến và triển khai nhiều dự án hợp tác quốc tế trong lĩnh vực y tế.', '<p>Bệnh viện Chợ Rẫy là một bệnh viện đa khoa trung ương cấp quốc gia, phục vụ Nam Bộ, nằm tại Quận 5, Thành phố Hồ Chí Minh. Đây là bệnh viện tuyến cuối hạng đặc biệt trực thuộc Bộ Y tế, đồng thời là trung tâm nghiên cứu khoa học, chỉ đạo tuyến và triển khai nhiều dự án hợp tác quốc tế trong lĩnh vực y tế.</p>\n', , '2025-06-21 14:41:04', '2025-06-21 14:41:04');
