INSERT INTO `markdown` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<p>Bác sĩ Nguyễn Văn Nam, chuyên gia hơn 20 năm nổi bật trong lĩnh vực hô hấp, phổi, chuyên chuẩn đoán và điều trị các bệnh lý liên quan đến hô hấp. Đã có nhiều năm trong kinh nghiệm điều trị các bệnh lý mãn tính hô hấp phức tạp: hen, lao, phế quản, ...</p>\r\n', 'Bác sĩ Nguyễn Văn Nam, chuyên gia hơn 20 năm nổi bật trong lĩnh vực hô hấp, phổi, chuyên chuẩn đoán và điều trị các bệnh lý liên quan đến hô hấp. Đã có nhiều năm trong kinh nghiệm điều trị các bệnh lý mãn tính hô hấp phức tạp: hen, lao, phế quản, ...', 'Khám điều trị: Lao, Lao kháng thuốc, Hen, COPD, Ung thư,...\r\nTốt nghiệp Bác sĩ Chuyên khoa II chuyên ngành bệnh Phổi và Lao, Đại học Y dược TP.HCM (2014)\r\nTốt nghiệp Bác sĩ Chuyên khoa I chuyên ngành bệnh Phổi và Lao, Đại học Y dược TP.HCM (2007)\r\nTốt nghiệp Bác sĩ Đa khoa Tổng quát, Đại học Y dược TP.HCM (1996)', 4, NULL, NULL, '2025-06-10 22:44:33', '2025-06-10 22:44:33'),
(2, '<p>Chuyên gia về lĩnh vực niềng răng chỉnh nha\r\nChuyên gia Điều trị chuyên sâu về lĩnh vực Răng Hàm Mặt</p>\r\n', 'Niềng răng chỉnh nha cho mọi trường hợp răng hô, móm, lệch lạc, sai khớp cắn\r\nNha khoa thẩm mỹ: Tẩy trắng răng, điều chỉnh cười hở lợi, Bọc răng sứ thiết kế nụ cười, Phục hình răng,...', 'Tốt nghiệp Chứng chỉ chỉnh nha (2022)\r\nTốt nghiệp BSCKI Nha khoa (2022)\r\nChứng chỉ hành nghề khám chữa bệnh do Sở Y tế cấp phép (2018)\r\nTốt nghiệp Bác sĩ Răng Hàm Mặt Đại học Y Dược TP. HCM (2011)', 15, NULL, NULL, '2025-06-19 14:34:07', '2025-06-19 14:34:07'),
(3, '<p>Đã có bằng thạc sĩ, có 20 năm kinh nghiệm trong việc nghành nha sĩ</p>\n', 'Đã có bằng thạc sĩ, có 20 năm kinh nghiệm trong việc nghành nha sĩ', 'Bác sĩ chuyên khoa miệng miền Trung', 16, NULL, NULL, '2025-06-19 20:56:45', '2025-06-19 20:56:45'),
(4, '<h1>Tiến sĩ, Bác sĩ Vũ Bá Việt</h1>\n<h2>Kinh nghiệm</h2>\n<ul>\n<li>16 năm kinh nghiệm trong chuyên ngành da liễu và laser – phẫu thuật trong da liễu</li>\n<li>10 năm kinh nghiệm nâng cơ, trẻ hóa da mặt bằng chỉ</li>\n<li>15 năm kinh nghiệm trong điều trị laser và trị liệu ánh sáng cho các tăng sắc tố, trẻ hóa da, sẹo lõm, sẹo lồi</li>\n<li>15 năm kinh nghiệm trong điều trị bệnh da liễu như trứng cá, rụng tóc, vảy nến, viêm da cơ địa…</li>\n<li>10 năm kinh nghiệm trong tạo hình khuôn mặt và trẻ hóa da bằng Filler, botox; 5 năm kinh nghiệm trong liệu pháp mesotherapy điều trị rạn má và trẻ hóa da, thon gọn cơ thể</li>\n<li>16 năm giảng dạy trong chuyên ngành Da liễu</li>\n<li>Kinh nghiệm trong điều trị chống lão hóa bằng RF, HIFU</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<ul>\n<li><strong>Viêm da cơ địa</strong>: Tổn thương da khô, ban đỏ kèm theo hiện tượng ngứa</li>\n<li><strong>Viêm da tiếp xúc</strong>: Tổn thương vùng bị tiếp xúc, dát đỏ, mụn nước, có thể loét, kèm ngứa</li>\n<li><strong>Viêm da dầu</strong>: Các màng dát màu đỏ hồng, có vảy da trắng mỏng nhờn dính kèm ngứa ở nếp gấp, rãnh mũi má</li>\n<li><strong>Mày đay</strong>: Sẩn phù, ngứa, phù mạch, nguyên nhân chủ yếu do dị ứng</li>\n<li><strong>Zona</strong>: Ban đỏ, đám mụn nước, vết loét, cảm giác ngứa rát dọc theo dây thần kinh</li>\n</ul>\n', '# Tiến sĩ, Bác sĩ Vũ Bá Việt\n\n## Kinh nghiệm\n- 16 năm kinh nghiệm trong chuyên ngành da liễu và laser – phẫu thuật trong da liễu  \n- 10 năm kinh nghiệm nâng cơ, trẻ hóa da mặt bằng chỉ  \n- 15 năm kinh nghiệm trong điều trị laser và trị liệu ánh sáng cho các tăng sắc tố, trẻ hóa da, sẹo lõm, sẹo lồi  \n- 15 năm kinh nghiệm trong điều trị bệnh da liễu như trứng cá, rụng tóc, vảy nến, viêm da cơ địa…  \n- 10 năm kinh nghiệm trong tạo hình khuôn mặt và trẻ hóa da bằng Filler, botox; 5 năm kinh nghiệm trong liệu pháp mesotherapy điều trị rạn má và trẻ hóa da, thon gọn cơ thể  \n- 16 năm giảng dạy trong chuyên ngành Da liễu  \n- Kinh nghiệm trong điều trị chống lão hóa bằng RF, HIFU  \n\n## Khám và điều trị\n- **Viêm da cơ địa**: Tổn thương da khô, ban đỏ kèm theo hiện tượng ngứa  \n- **Viêm da tiếp xúc**: Tổn thương vùng bị tiếp xúc, dát đỏ, mụn nước, có thể loét, kèm ngứa  \n- **Viêm da dầu**: Các màng dát màu đỏ hồng, có vảy da trắng mỏng nhờn dính kèm ngứa ở nếp gấp, rãnh mũi má  \n- **Mày đay**: Sẩn phù, ngứa, phù mạch, nguyên nhân chủ yếu do dị ứng  \n- **Zona**: Ban đỏ, đám mụn nước, vết loét, cảm giác ngứa rát dọc theo dây thần kinh  \n', 'Bác sĩ có hơn 16 năm kinh nghiệm trong khám và điều trị Da liễu, Da liễu Thẩm mỹ \nTrưởng khoa Khoa nghiên cứu và ứng dụng công nghệ tế bào gốc - Bệnh viện Da liễu Trung ương.', 18, NULL, NULL, '2025-06-21 14:48:10', '2025-06-21 14:48:10'),
(5, '<h1>Thạc sĩ, Bác sĩ Trần Thị Liễu</h1>\n<h2>Kinh nghiệm</h2>\n<ul>\n<li>Bác sĩ có 20 năm kinh nghiệm điều trị thành công hàng nghìn ca bệnh da liễu từ đơn giản đến phức tạp, khôi phục lại sự tự tin và hạnh phúc cho bệnh nhân</li>\n<li>Kinh nghiệm điều trị nhiều vấn đề về da ở trẻ nhỏ như viêm da, dị ứng da, da mụn… Trong đó bác sĩ chuyên sâu nhất về điều trị viêm da và mụn</li>\n<li>Giám đốc Phòng khám Da liễu</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<ul>\n<li>Khám, trị mụn y khoa</li>\n<li>Khám, chữa thâm mụn</li>\n<li>Trị sẹo rỗ</li>\n<li>Trị nám da</li>\n<li>Trị tàn nhang</li>\n<li>Trẻ hóa da</li>\n<li>Khám bệnh da liễu: viêm da, dị ứng da</li>\n</ul>\n<h2>Quá trình công tác</h2>\n<ul>\n<li>Giám đốc Phòng khám Da liễu (2017 – nay)</li>\n<li>Bác sĩ tại Bệnh viện Đa khoa Bắc Hà (2015 – 2017)</li>\n<li>Bác sĩ tại Bệnh viện Đa khoa Hồng Ngọc (2011 – 2015)</li>\n<li>Bác sĩ tại Bệnh viện Đa khoa tỉnh Ninh Bình (2008 – 2011)</li>\n</ul>\n', '# Thạc sĩ, Bác sĩ Trần Thị Liễu\n\n## Kinh nghiệm\n- Bác sĩ có 20 năm kinh nghiệm điều trị thành công hàng nghìn ca bệnh da liễu từ đơn giản đến phức tạp, khôi phục lại sự tự tin và hạnh phúc cho bệnh nhân  \n- Kinh nghiệm điều trị nhiều vấn đề về da ở trẻ nhỏ như viêm da, dị ứng da, da mụn… Trong đó bác sĩ chuyên sâu nhất về điều trị viêm da và mụn  \n- Giám đốc Phòng khám Da liễu\n\n## Khám và điều trị\n- Khám, trị mụn y khoa  \n- Khám, chữa thâm mụn  \n- Trị sẹo rỗ  \n- Trị nám da  \n- Trị tàn nhang  \n- Trẻ hóa da  \n- Khám bệnh da liễu: viêm da, dị ứng da  \n\n## Quá trình công tác\n- Giám đốc Phòng khám Da liễu (2017 – nay)  \n- Bác sĩ tại Bệnh viện Đa khoa Bắc Hà (2015 – 2017)  \n- Bác sĩ tại Bệnh viện Đa khoa Hồng Ngọc (2011 – 2015)  \n- Bác sĩ tại Bệnh viện Đa khoa tỉnh Ninh Bình (2008 – 2011)  ', 'Bác sĩ có 20 năm kinh nghiệm điều trị thành công hàng nghìn ca bệnh da liễu từ đơn giản đến phức tạp, khôi phục lại sự tự tin và hạnh phúc cho hàng nghìn bệnh nhân\nBác sĩ có kinh nghiệm điều trị nhiều vấn đề về da ở trẻ nhỏ như: viêm da, dị ứng da, da mụn,... Trong đó, bác sĩ chuyên sâu nhất về điều trị về viêm da và mụn.', 19, NULL, NULL, '2025-06-21 14:52:49', '2025-06-21 14:52:49'),
(6, '<h3>Bác sĩ Nguyễn Việt Anh</h3>\n<p><strong>Chuyên môn:</strong><br>\nBác sĩ có nhiều năm kinh nghiệm về thăm khám và điều trị Nha khoa.</p>\n<p><strong>Đào tạo:</strong><br>\nBác sĩ được đào tạo tại các bệnh viện lớn như:</p>\n<ul>\n<li>Bệnh viện Răng hàm mặt Trung ương</li>\n<li>Đại học Y dược</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Xử trí ngộ độc thuốc tê, sốc phản vệ</li>\n<li>Phục Hình Mão răng sứ</li>\n<li>Implant</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Răng Hàm Mặt, Đại học Y dược TP. HCM</li>\n</ul>\n<p><strong>Chứng chỉ:</strong></p>\n<ul>\n<li>Chứng chỉ nha chu, Đại học Y dược TP. HCM</li>\n<li>Chứng chỉ Implant, Bệnh viện Răng hàm mặt Trung ương TP. HCM</li>\n<li>Xử trí ngộ độc thuốc tê, sốc phản vệ, Trung tâm Giải pháp Y khoa Messi</li>\n<li>Phục Hình Mão răng sứ, Trung tâm Giải pháp Y khoa Messi</li>\n<li>Lớp nhiếp ảnh Nha khoa, Trung tâm Giải pháp Y khoa Messi</li>\n<li>Lớp Veneer SPS, Sagodent</li>\n<li>Lớp Implant P2P, Sagodent</li>\n<li>Lớp Nội nha Đương đại, Bệnh viện Răng hàm mặt Trung ương TP. HCM</li>\n</ul>\n', '### Bác sĩ Nguyễn Việt Anh\n\n**Chuyên môn:**  \nBác sĩ có nhiều năm kinh nghiệm về thăm khám và điều trị Nha khoa.\n\n**Đào tạo:**  \nBác sĩ được đào tạo tại các bệnh viện lớn như:  \n- Bệnh viện Răng hàm mặt Trung ương   \n- Đại học Y dược\n\n**Dịch vụ khám và điều trị:**  \n- Xử trí ngộ độc thuốc tê, sốc phản vệ  \n- Phục Hình Mão răng sứ  \n- Implant  \n\n**Quá trình đào tạo:**  \n- Răng Hàm Mặt, Đại học Y dược TP. HCM  \n\n**Chứng chỉ:**  \n- Chứng chỉ nha chu, Đại học Y dược TP. HCM  \n- Chứng chỉ Implant, Bệnh viện Răng hàm mặt Trung ương TP. HCM  \n- Xử trí ngộ độc thuốc tê, sốc phản vệ, Trung tâm Giải pháp Y khoa Messi  \n- Phục Hình Mão răng sứ, Trung tâm Giải pháp Y khoa Messi  \n- Lớp nhiếp ảnh Nha khoa, Trung tâm Giải pháp Y khoa Messi  \n- Lớp Veneer SPS, Sagodent  \n- Lớp Implant P2P, Sagodent  \n- Lớp Nội nha Đương đại, Bệnh viện Răng hàm mặt Trung ương TP. HCM  ', 'Bác sĩ có nhiều năm kinh nghiệm về thăm khám và điều trị Nha khoa \nBác sĩ được đào tạo tại các bệnh viện lớn như Bệnh viện Răng hàm mặt.', 30, NULL, NULL, '2025-06-26 22:40:26', '2025-06-26 22:40:26'),
(7, '<h3>Bác sĩ Trần Đức Mạnh</h3>\n<p><strong>Chuyên môn:</strong><br>\nNhiều năm kinh nghiệm trong khám và điều trị các vấn đề Nha khoa.</p>\n<p><strong>Học tập và hội nghị quốc tế:</strong><br>\nBác sĩ từng học tập và tham gia hội nghị ở nước ngoài:</p>\n<ul>\n<li>Singapore</li>\n<li>Indonesia</li>\n<li>Thailand</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Chỉnh nha</li>\n<li>Trồng răng Implant</li>\n<li>Phẫu thuật nha chu, tiểu phẫu răng khôn</li>\n<li>Phục hình sứ thẩm mỹ</li>\n</ul>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Phòng khám đa khoa Đại học Y Vinh, Nghệ An</li>\n<li>Bệnh viện thẩm mỹ Việt Mỹ - TP. HCM</li>\n<li>Phòng khám Đa khoa An Lộc, Tân An, Long An</li>\n<li>Các Phòng khám Nha khoa:\n<ul>\n<li>Nha khoa Ba Đình (Hà Nội)</li>\n<li>Nha khoa SSD (TP. HCM)</li>\n<li>Nha khoa Hoàng Linh (TP. HCM)</li>\n<li>Nha khoa Quốc Đạt (TP. HCM)</li>\n</ul>\n</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Bác sĩ Chuyên ngành Răng Hàm Mặt (2013)</li>\n</ul>\n<p><strong>Chứng chỉ:</strong></p>\n<ul>\n<li>Chỉnh nha trong suốt Invisalign (2020)</li>\n<li>Chuyên khoa Implant – Đại học Y Dược Thành phố Hồ Chí Minh (2018)</li>\n<li>Chỉnh nha Bệnh viện Răng Hàm Mặt Thành phố Hồ Chí Minh (2016)</li>\n<li>Chỉnh nha POS (Progressive Orthodontic Seminar) – USA (2013)</li>\n</ul>\n<p><strong>Thành viên các tổ chức chuyên môn:</strong></p>\n<ul>\n<li>Hiệp hội chỉnh nha Việt Nam</li>\n</ul>\n', '### Bác sĩ Trần Đức Mạnh\n\n**Chuyên môn:**  \nNhiều năm kinh nghiệm trong khám và điều trị các vấn đề Nha khoa.\n\n**Học tập và hội nghị quốc tế:**  \nBác sĩ từng học tập và tham gia hội nghị ở nước ngoài:  \n- Singapore  \n- Indonesia  \n- Thailand\n\n**Dịch vụ khám và điều trị:**  \n- Chỉnh nha  \n- Trồng răng Implant  \n- Phẫu thuật nha chu, tiểu phẫu răng khôn  \n- Phục hình sứ thẩm mỹ  \n\n**Quá trình công tác:**  \n- Phòng khám đa khoa Đại học Y Vinh, Nghệ An  \n- Bệnh viện thẩm mỹ Việt Mỹ - TP. HCM  \n- Phòng khám Đa khoa An Lộc, Tân An, Long An  \n- Các Phòng khám Nha khoa:  \n  - Nha khoa Ba Đình (Hà Nội)  \n  - Nha khoa SSD (TP. HCM)  \n  - Nha khoa Hoàng Linh (TP. HCM)  \n  - Nha khoa Quốc Đạt (TP. HCM)  \n\n**Quá trình đào tạo:**  \n- Bác sĩ Chuyên ngành Răng Hàm Mặt (2013)\n\n**Chứng chỉ:**  \n- Chỉnh nha trong suốt Invisalign (2020)  \n- Chuyên khoa Implant – Đại học Y Dược Thành phố Hồ Chí Minh (2018)  \n- Chỉnh nha Bệnh viện Răng Hàm Mặt Thành phố Hồ Chí Minh (2016)  \n- Chỉnh nha POS (Progressive Orthodontic Seminar) – USA (2013)\n\n**Thành viên các tổ chức chuyên môn:**  \n- Hiệp hội chỉnh nha Việt Nam  \n', 'Nhiều năm kinh nghiệm trong khám và điều trị các vấn đề Nha khoa\nBác sĩ từng học tập và tham gia hội nghị ở nước ngoài: Singapore, Indonesia, Thailand...', 29, NULL, NULL, '2025-06-26 22:42:04', '2025-06-26 22:42:04'),
(8, '<h3>Bác sĩ Chuyên khoa I Nguyễn Văn Phát</h3>\n<p><strong>Chức vụ hiện tại:</strong></p>\n<ul>\n<li>Phó Giám đốc Bệnh viện Ung bướu Hưng Việt</li>\n</ul>\n<p><strong>Kinh nghiệm:</strong></p>\n<ul>\n<li>Gần 40 năm kinh nghiệm khám và điều trị các bệnh chuyên khoa Hô hấp</li>\n<li>Nguyên Phó khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương</li>\n</ul>\n<p><strong>Đối tượng khám:</strong></p>\n<ul>\n<li>Bác sĩ nhận khám cho bệnh nhân từ 3 tuổi trở lên</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Bác sĩ có thế mạnh trong khám và điều trị các bệnh hô hấp</li>\n<li>Viêm loét dạ dày, hành tá tràng: Đau thượng vị, ợ hơi, ợ chua, buồn nôn</li>\n<li>Viêm thực quản trào ngược: Ợ nóng, đau xương ức, ho khan</li>\n<li>Viêm đại tràng co thắt, hội chứng trào ngược: Đau bụng quang rốn, đau quặn thành cơn, đại tiện lúc lỏng, lúc táo</li>\n<li>Đái tháo đường: Ăn nhiều, uống nhiều, đái nhiều, sút cân</li>\n<li>Tăng huyết áp: Đau đầu, chóng mặt, cơn nóng bừng mặt</li>\n<li>Bệnh lý tim mạch: Hồi hộp, đau nhói ngực trái</li>\n<li>Suy van tĩnh mạch chi dưới: Phù chân, tê bì, đau bắp chân</li>\n<li>Bệnh lý đường hô hấp (hen phế quản, viêm phổi, viêm phế quản): Ho có đờm, tức ngực, khó thở, khò khè</li>\n<li>Viêm khớp dạng thấp: Đau khớp đối xứng hai bên, sưng đau, cứng các khớp ngón tay hai bên</li>\n<li>Thoát vị đĩa đệm CSTL: Đau thắt lưng, đau thần kinh tọa</li>\n<li>Bệnh lý xương khớp: Đau các điểm bám gân, ngón tay lò xo, gout</li>\n<li>Bệnh lý tuyến giáp</li>\n<li>Các bệnh lý khối u, ung thư</li>\n</ul>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Phó Giám đốc, Bệnh viện Ung bướu Hưng Việt (2012 - nay)</li>\n<li>Phụ trách khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (2010 - 2012)</li>\n<li>Phó khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (2000 - 2010)</li>\n<li>Bác sĩ khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (1982 - 1999)</li>\n</ul>\n', '### Bác sĩ Chuyên khoa I Nguyễn Văn Phát\n\n**Chức vụ hiện tại:**  \n- Phó Giám đốc Bệnh viện Ung bướu Hưng Việt\n\n**Kinh nghiệm:**  \n- Gần 40 năm kinh nghiệm khám và điều trị các bệnh chuyên khoa Hô hấp  \n- Nguyên Phó khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương\n\n**Đối tượng khám:**  \n- Bác sĩ nhận khám cho bệnh nhân từ 3 tuổi trở lên\n\n**Dịch vụ khám và điều trị:**  \n- Bác sĩ có thế mạnh trong khám và điều trị các bệnh hô hấp  \n- Viêm loét dạ dày, hành tá tràng: Đau thượng vị, ợ hơi, ợ chua, buồn nôn  \n- Viêm thực quản trào ngược: Ợ nóng, đau xương ức, ho khan  \n- Viêm đại tràng co thắt, hội chứng trào ngược: Đau bụng quang rốn, đau quặn thành cơn, đại tiện lúc lỏng, lúc táo  \n- Đái tháo đường: Ăn nhiều, uống nhiều, đái nhiều, sút cân  \n- Tăng huyết áp: Đau đầu, chóng mặt, cơn nóng bừng mặt  \n- Bệnh lý tim mạch: Hồi hộp, đau nhói ngực trái  \n- Suy van tĩnh mạch chi dưới: Phù chân, tê bì, đau bắp chân  \n- Bệnh lý đường hô hấp (hen phế quản, viêm phổi, viêm phế quản): Ho có đờm, tức ngực, khó thở, khò khè  \n- Viêm khớp dạng thấp: Đau khớp đối xứng hai bên, sưng đau, cứng các khớp ngón tay hai bên  \n- Thoát vị đĩa đệm CSTL: Đau thắt lưng, đau thần kinh tọa  \n- Bệnh lý xương khớp: Đau các điểm bám gân, ngón tay lò xo, gout  \n- Bệnh lý tuyến giáp  \n- Các bệnh lý khối u, ung thư  \n\n**Quá trình công tác:**  \n- Phó Giám đốc, Bệnh viện Ung bướu Hưng Việt (2012 - nay)  \n- Phụ trách khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (2010 - 2012)  \n- Phó khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (2000 - 2010)  \n- Bác sĩ khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương (1982 - 1999)\n', 'Gần 40 năm kinh nghiệm khám và điều trị các bệnh Hô hấp\nPhó Giám đốc Bệnh viện Ung bướu Hưng Việt\nNguyên Phó khoa Hồi sức cấp cứu, Bệnh viện Phổi Trung ương', 28, NULL, NULL, '2025-06-26 22:43:49', '2025-06-26 22:43:49'),
(9, '<h3>PGS. TS Phạm Minh Nghĩa</h3>\n<p><strong>Chuyên môn:</strong><br>\nBác sĩ có gần 40 năm kinh nghiệm trong khám và điều trị tim mạch.</p>\n<p><strong>Chức vụ hiện tại:</strong></p>\n<ul>\n<li>Giám đốc Trung tâm Khám chữa bệnh - Phòng khám Đa khoa Prime</li>\n</ul>\n<p><strong>Đối tượng khám:</strong></p>\n<ul>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Tăng huyết áp</li>\n<li>Suy tim</li>\n<li>Bệnh mạch vành</li>\n<li>Rối loạn nhịp tim</li>\n<li>Bệnh mạch máu ngoại vi</li>\n<li>Bệnh van tim</li>\n<li>Bệnh tim bẩm sinh</li>\n<li>Rối loạn chuyển hóa lipid máu</li>\n<li>Đái tháo đường</li>\n<li>Bệnh lý tuyến giáp</li>\n<li>Các bệnh lý đường tiêu hóa: Bao gồm các bệnh về dạ dày, đại tràng, gan mật…</li>\n<li>Các bệnh lý đường hô hấp như: COPD, các bệnh đường phế quản, bệnh lý của phổi…</li>\n<li>Các bệnh lý về thần kinh: Sau tai biến mạch máu não, bệnh thần kinh ngoại vi…</li>\n<li>Các bệnh lý về xương khớp: Bệnh Gout, thoái hóa khớp…</li>\n<li>Các bệnh lý về tim mạch và chuyển hóa</li>\n</ul>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Giám đốc Trung tâm khám chữa bệnh PMC, Thành viên Hội đồng chuyên môn PMC (nay)</li>\n<li>PGS.TS phụ trách Viện trưởng kiêm Chủ nhiệm khoa A1C, Viện Điều trị cán bộ cao cấp Quân đội - Bệnh viện Trung Ương Quân đội 108 (2018 - 2023)</li>\n<li>Tiến sỹ, Chủ nhiệm khoa, Khoa A1, Bệnh viện Trung Ương Quân Đội 108 (2012 - 2018)</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Đào tạo nâng cao - Tim mạch can thiệp, Viện trường La Timone - Đại học Y khoa Mác Xây - Cộng Hòa Pháp (1/2004 - 12/2004)</li>\n<li>Nghiên cứu Tim mạch, Bệnh viện Tim mạch - Học viện Quân Y (3/2000 - 3/2006)</li>\n<li>Bác sĩ chuyên khoa tim mạch và tim mạch can thiệp, Viện trường La Timone - Đại học Y khoa Mác Xây - Cộng hòa Pháp (1995 - 1997)</li>\n<li>Bác sĩ chuyên khoa I, nội chung, Học viện Quân Y (1990 - 1992)</li>\n<li>Bác sĩ Đa khoa, Học Viện Quân Y (1979 - 1985)</li>\n</ul>\n', '### PGS. TS Phạm Minh Nghĩa\n**Chuyên môn:**  \nBác sĩ có gần 40 năm kinh nghiệm trong khám và điều trị tim mạch.\n\n**Chức vụ hiện tại:**  \n- Giám đốc Trung tâm Khám chữa bệnh - Phòng khám Đa khoa Prime\n\n**Đối tượng khám:**  \n- Bác sĩ nhận khám mọi độ tuổi\n\n**Dịch vụ khám và điều trị:**  \n- Tăng huyết áp  \n- Suy tim  \n- Bệnh mạch vành  \n- Rối loạn nhịp tim  \n- Bệnh mạch máu ngoại vi  \n- Bệnh van tim  \n- Bệnh tim bẩm sinh  \n- Rối loạn chuyển hóa lipid máu  \n- Đái tháo đường  \n- Bệnh lý tuyến giáp  \n- Các bệnh lý đường tiêu hóa: Bao gồm các bệnh về dạ dày, đại tràng, gan mật…  \n- Các bệnh lý đường hô hấp như: COPD, các bệnh đường phế quản, bệnh lý của phổi…  \n- Các bệnh lý về thần kinh: Sau tai biến mạch máu não, bệnh thần kinh ngoại vi…  \n- Các bệnh lý về xương khớp: Bệnh Gout, thoái hóa khớp…  \n- Các bệnh lý về tim mạch và chuyển hóa  \n\n**Quá trình công tác:**  \n- Giám đốc Trung tâm khám chữa bệnh PMC, Thành viên Hội đồng chuyên môn PMC (nay)  \n- PGS.TS phụ trách Viện trưởng kiêm Chủ nhiệm khoa A1C, Viện Điều trị cán bộ cao cấp Quân đội - Bệnh viện Trung Ương Quân đội 108 (2018 - 2023)  \n- Tiến sỹ, Chủ nhiệm khoa, Khoa A1, Bệnh viện Trung Ương Quân Đội 108 (2012 - 2018)\n\n**Quá trình đào tạo:**  \n- Đào tạo nâng cao - Tim mạch can thiệp, Viện trường La Timone - Đại học Y khoa Mác Xây - Cộng Hòa Pháp (1/2004 - 12/2004)  \n- Nghiên cứu Tim mạch, Bệnh viện Tim mạch - Học viện Quân Y (3/2000 - 3/2006)  \n- Bác sĩ chuyên khoa tim mạch và tim mạch can thiệp, Viện trường La Timone - Đại học Y khoa Mác Xây - Cộng hòa Pháp (1995 - 1997)  \n- Bác sĩ chuyên khoa I, nội chung, Học viện Quân Y (1990 - 1992)  \n- Bác sĩ Đa khoa, Học Viện Quân Y (1979 - 1985)\n', 'Bác sĩ có gần 40 năm kinh nghiệm trong khám và điều trị tim mạch \nGiám đốc Trung tâm Khám chữa bệnh -  Phòng khám Đa khoa Prime\nBác sĩ nhận khám mọi độ tuổi', 31, NULL, NULL, '2025-06-26 22:46:19', '2025-06-26 22:46:19'),
(10, '<h3>Bác sĩ Chuyên khoa II Trần Văn Lăng</h3>\n<p><strong>Chuyên môn:</strong><br>\nBác sĩ có gần 15 năm kinh nghiệm trong lĩnh vực Tai mũi họng.</p>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Từng công tác tại Bệnh viện Thống Nhất</li>\n<li>Hiện đang phụ trách Khoa Liên chuyên khoa Mắt – Tai Mũi Họng – Răng Hàm Mặt – Da Liễu, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn</li>\n</ul>\n<p><strong>Đối tượng khám:</strong></p>\n<ul>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai</li>\n<li>Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ</li>\n<li>Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi</li>\n<li>Viêm họng: Đau rát họng, hôi miệng, vướng họng</li>\n<li>Viêm Amidan: Sốt, đau họng, ngủ ngáy</li>\n<li>Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói</li>\n<li>Viêm mũi VA: Ngạt mũi, ngủ ngáy</li>\n<li>Viêm thanh quản: Khàn tiếng</li>\n<li>Hạt xơ thanh quản: Khàn tiếng, hụt hơi</li>\n<li>Dị vật đường thở: Khó thở</li>\n<li>Viêm đường phế quản: Ho, tức ngực, khó thở</li>\n<li>Hen phế quản: Ho, khó thở</li>\n<li>Viêm phổi: Sốt, ho, khó thở</li>\n<li>Nấm ống tai: Ngứa tai, ù tai</li>\n</ul>\n', '### Bác sĩ Chuyên khoa II Trần Văn Lăng\n\n**Chuyên môn:**  \nBác sĩ có gần 15 năm kinh nghiệm trong lĩnh vực Tai mũi họng.\n\n**Quá trình công tác:**  \n- Từng công tác tại Bệnh viện Thống Nhất  \n- Hiện đang phụ trách Khoa Liên chuyên khoa Mắt – Tai Mũi Họng – Răng Hàm Mặt – Da Liễu, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\n\n**Đối tượng khám:**  \n- Bác sĩ nhận khám mọi độ tuổi\n\n**Dịch vụ khám và điều trị:**  \n- Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai  \n- Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ  \n- Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi  \n- Viêm họng: Đau rát họng, hôi miệng, vướng họng  \n- Viêm Amidan: Sốt, đau họng, ngủ ngáy  \n- Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói  \n- Viêm mũi VA: Ngạt mũi, ngủ ngáy  \n- Viêm thanh quản: Khàn tiếng  \n- Hạt xơ thanh quản: Khàn tiếng, hụt hơi  \n- Dị vật đường thở: Khó thở  \n- Viêm đường phế quản: Ho, tức ngực, khó thở  \n- Hen phế quản: Ho, khó thở  \n- Viêm phổi: Sốt, ho, khó thở  \n- Nấm ống tai: Ngứa tai, ù tai  \n', 'Bác sĩ có gần 15 năm kinh nghiệm trong lĩnh vực Tai mũi họng\nTừng công tác tại Bệnh viện Thống Nhất\nHiện đang phụ trách Khoa Liên chuyên khoa Mắt – Tai Mũi Họng – Răng Hàm Mặt – Da Liễu, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\nBác sĩ nhận khám mọi độ tuổi', 32, NULL, NULL, '2025-06-26 23:09:56', '2025-06-26 23:09:56'),
(11, '<h3>Bác sĩ Chuyên khoa I Trương Ngọc Đại</h3>\n<p><strong>Chuyên môn:</strong><br>\nBác sĩ có 10 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng.</p>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Hiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1 (2019 - nay)</li>\n<li>Phòng khám Đa khoa Nhân Hậu (2018 - 2020)</li>\n<li>Phòng khám Đa khoa Hồng Lạc (2013 - 2016)</li>\n</ul>\n<p><strong>Đối tượng khám:</strong></p>\n<ul>\n<li>Bác sĩ nhận khám từ 15 tuổi trở lên</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Học Chuyên khoa I Đại học Y Dược TP. HCM (2016 - 2018)</li>\n<li>Tốt nghiệp Bác sĩ Đại học Y Dược TP. HCM (2013)</li>\n</ul>\n', '### Bác sĩ Chuyên khoa I Trương Ngọc Đại\n\n**Chuyên môn:**  \nBác sĩ có 10 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng.\n\n**Quá trình công tác:**  \n- Hiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1 (2019 - nay)  \n- Phòng khám Đa khoa Nhân Hậu (2018 - 2020)  \n- Phòng khám Đa khoa Hồng Lạc (2013 - 2016)\n\n**Đối tượng khám:**  \n- Bác sĩ nhận khám từ 15 tuổi trở lên\n\n**Dịch vụ khám và điều trị:**  \n- Ù tai, đau tai, chảy máu tai  \n- Thủng màng nhĩ, điếc đột ngột  \n- Viêm tai giữa  \n- Amidan, V.A  \n- Viêm xoang  \n- Nghẹt mũi  \n- Hay bị chảy máu cam  \n- Đau cổ họng, khó nuốt  \n- Ho kéo dài  \n\n**Quá trình đào tạo:**  \n- Học Chuyên khoa I Đại học Y Dược TP. HCM (2016 - 2018)  \n- Tốt nghiệp Bác sĩ Đại học Y Dược TP. HCM (2013)\n', '10 năm kinh nghiệm lĩnh vực Tai mũi họng\nHiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\nBác sĩ nhận khám từ 15 tuổi trở lên', 33, NULL, NULL, '2025-06-26 23:11:04', '2025-06-26 23:11:04'),
(12, '<h3>BSCKI Phạm Duy Thắng</h3>\n<p><strong>Chuyên môn:</strong><br>\nGần 10 năm kinh nghiệm trong khám và điều trị Tim mạch - Tim mạch Can thiệp.</p>\n<p><strong>Quá trình công tác:</strong></p>\n<ul>\n<li>Bác sĩ khoa Tim mạch, Can thiệp mạch máu Bệnh viện Quốc tế City (10/2024 - nay)</li>\n<li>Bác sĩ Tim mạch can thiệp Bệnh viện Đa khoa Tâm Anh (2023 - 09/2024)</li>\n<li>Bệnh viện Đa khoa tỉnh Quảng Trị, Bác sĩ Nội tim mạch - Tim mạch can thiệp (2017 - 2023)</li>\n</ul>\n<p><strong>Dịch vụ khám và điều trị:</strong></p>\n<ul>\n<li>Điều trị các bệnh lý về nội tim mạch</li>\n<li>Tim mạch can thiệp</li>\n</ul>\n<p><strong>Quá trình đào tạo:</strong></p>\n<ul>\n<li>Bác sĩ Chuyên khoa I Nội tổng quát, Đại học Y Khoa Phạm Ngọc Thạch (2020 - 2022)</li>\n<li>Bác sĩ Đa khoa Đại học Y Dược Huế (2011 - 2017)</li>\n</ul>\n', '### BSCKI Phạm Duy Thắng\n\n**Chuyên môn:**  \nGần 10 năm kinh nghiệm trong khám và điều trị Tim mạch - Tim mạch Can thiệp.\n\n**Quá trình công tác:**  \n- Bác sĩ khoa Tim mạch, Can thiệp mạch máu Bệnh viện Quốc tế City (10/2024 - nay)  \n- Bác sĩ Tim mạch can thiệp Bệnh viện Đa khoa Tâm Anh (2023 - 09/2024)  \n- Bệnh viện Đa khoa tỉnh Quảng Trị, Bác sĩ Nội tim mạch - Tim mạch can thiệp (2017 - 2023)\n\n**Dịch vụ khám và điều trị:**  \n- Điều trị các bệnh lý về nội tim mạch  \n- Tim mạch can thiệp  \n\n**Quá trình đào tạo:**  \n- Bác sĩ Chuyên khoa I Nội tổng quát, Đại học Y Khoa Phạm Ngọc Thạch (2020 - 2022)  \n- Bác sĩ Đa khoa Đại học Y Dược Huế (2011 - 2017)\n', 'Gần 10 năm kinh nghiệm trong khám và điều trị Tim mạch - Tim mạch Can thiệp \nTừng là bác sĩ Tim mạch Bệnh viện Tâm Anh, Bệnh viện Tỉnh Quảng Trị ', 34, NULL, NULL, '2025-06-26 23:12:57', '2025-06-26 23:12:57');
