INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(1, 'Chuyên khoa Phổi', , '<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện, phòng khám lớn  như: Bệnh viện Đại học Y dược, Phòng khám Phổi Sài Gòn, Bệnh viện Phổi Trung ương,...\r\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Phổi Việt Nam, Hội Hô Hấp Việt Nam...</p>\r\n', 'Khám và điều trị\r\nLao\r\nLao kháng thuốc\r\nHen\r\nCOPD\r\nCác bệnh Phổi nghề nghiệp\r\nCác bệnh hô hấp', '2025-06-10 22:44:05', '2025-06-10 22:44:05');
