INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(3, 'Chuyên khoa tai mũi họng', , '<p>Chuyên khoa xử lí các trường hợp: Ù tai, đau tai, chảy máu tai, Thủng màng nhĩ, điếc đột ngột, Điếc đột ngột, Viêm tai giữa, Viêm xoang, ....</p>\n', 'Chuyên khoa xử lí các trường hợp: Ù tai, đau tai, chảy máu tai, Thủng màng nhĩ, điếc đột ngột, Điếc đột ngột, Viêm tai giữa, Viêm xoang, ....', '2025-06-21 14:09:20', '2025-06-21 14:09:20');
INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(4, 'Chuyên khoa Tim mạch', , '<p>Chuyên khoa xử lí các trường hợp bị khó thở, đau tim, đau ngực, tụt huyết áp, hạ đường huyết, rối loạn mỡ máu, ....</p>\n', 'Chuyên khoa xử lí các trường hợp bị khó thở, đau tim, đau ngực, tụt huyết áp, hạ đường huyết, rối loạn mỡ máu, ....', '2025-06-21 14:10:30', '2025-06-21 14:10:30');
INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(5, 'Chuyên khoa da liễu', , '<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại thành phố Hồ Chí Minh.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại thành phố Hồ Chí Minh như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu thành phố Hồ Chí Minh</p>\n', 'BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại thành phố Hồ Chí Minh.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại thành phố Hồ Chí Minh như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu thành phố Hồ Chí Minh', '2025-06-21 14:43:52', '2025-06-21 14:43:52');
